@Matthew_4_Trump @blanarovich Also it appears the data used by FDA was based on the EUA. 

Seems they ignored the VAERS data. Wasn’t this required by the 1986 NCVIA to obtain liability exemption for vaccines?

So does this relegate it to the same status as a drug and open Pfizer up to class action lawsuits?

